import React, { Fragment } from "react";
import Planet from './planet'

const ClickOnPlanet = (name) => {
console.log(`Um click no planeta: ${name}`)
}

const Planets = () => {
    return (
        <Fragment>
            <h3>Planet List</h3>
            <button>Show Message!</button>
            <hr/>
            <Planet name="Mercúrio"
                description="Mercúrio é o menor e mais interno planeta do Sistema Solar, orbitando o Sol a cada 87,969 dias terrestres. A sua órbita tem a maior excentricidade e o seu eixo apresenta a menor inclinação em relação ao plano da órbita dentre todos os planetas do Sistema Solar. "
                img_url="https://static.mundoeducacao.uol.com.br/mundoeducacao/conteudo_legenda/e8a8426182d5c9d3ce5d4d6e6358b128.jpg"
                link="https://pt.wikipedia.org/wiki/Merc%C3%BArio_(planeta)"
                title_with_underline={true}
                gray={true}
            />
            <Planet name="Plutão"
                description="Plutão é um planeta anão do Sistema Solar e o nono maior e décimo mais massivo objeto observado diretamente orbitando o Sol. "
                img_url="https://upload.wikimedia.org/wikipedia/commons/e/ef/Pluto_in_True_Color_-_High-Res.jpg"
                ClickOnPlanet={ClickOnPlanet}
            />
        </Fragment>
    )
}

export default Planets;
